  \"2016-01-28T07:29:06.018364\",\n\t\"name\": \"eastbound-tunnel-and-bridge-traffic-annual-volume-port-authority-of-ny-nj-beginning-2002\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Port Authority collects eastbound vehicle
  traffic volumes from its toll plazas at the six Port Authority vehicular crossings
  (i.e., George Washington Bridge, Holland Tunnel, Lincoln Tunnel, Goethals Bridge,
  Outerbridge Crossing and Bayonne Bridge).  This dataset contains annual eastbound
  traffic volumes for each crossing and for all Port Authority crossings combined,
  based on vehicles passing through Authorityu2019s toll plazas, for each year from
  2002 through 2012.  The dataset contains traffic volumes for three types of vehicles
  (autos, buses, trucks) for each year.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
